import React from 'react'

import './Alumini.css'
import p1 from '../images/himanshu.jfif'
import p2 from '../images/anurag.jfif'
import p3 from '../images/abhishek.jfif'
import p4 from '../images/ks.jfif'
import logo from "./logo.gif"
import GoogleIcon from '@mui/icons-material/Google';
import TwitterIcon from '@mui/icons-material/Twitter';
import FacebookIcon from '@mui/icons-material/Facebook';
import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
const Alumini = () => {
  


  return (

    <div>
      <center><h1>Our Alumini...</h1> </center>
   


      <div id="login-container" style={{backgroundColor:'#4682B4'}}>
  <div class="profile-img"  >
    <img src={p1} style={{height :'100px',width:'100px',borderRadius:'50px'}} />
  </div>

    <center> <div className="name" style={{fontSize:'larger',padding:'10px',fontWeight:'bold',backgroundColor:'#5b5f97',width:'410px'}}>
    Sattwik Maiti Sri venkata
  </div>
  </center>
  <div class="description" style={{fontSize:'medium',padding:'10px',fontWeight:'bold',backgroundColor:'white'}}>
   
  </div>
  
  <div class="social">
    <a><GitHubIcon className="icon" style={{
    backgroundColor: '#5b5f97',borderRadius:'10px' ,fontSize:'40px'}}/></a>
    <a><TwitterIcon  className="icon"style={{
    
    backgroundColor: '#5b5f97',borderRadius:'10px',fontSize:'40px'}}/></a>
    <a><LinkedInIcon  className="icon" style={{
    
    backgroundColor: '#5b5f97',borderRadius:'10px',fontSize:'40px'}}/></a>
  </div>


  <button>EMAIL </button>
  
  
</div>
    </div>
  )
}

export default Alumini
